import React from 'react';
import './HomeSection.css';
import HomeImage from '../../Assets/Home Page Images/pexels-photo-547115.png';

const HomeSection = () => {
  return (
    <section id='section1'>
        <img src={HomeImage} id='HomeImage' alt='HomeSection Image'/>
    </section>
  )
}

export default HomeSection
